window.bookSummaryJSON = "<p>Darwin, a video game addict, is sitting in his bathrobe and slippers playing his favorite MMO on a Christmas night when an uninvited guest breaks into his house to steal his belongings. </p> <p>After the scuffle is over he finds himself transported into one of the sword and magic RPG-style MMOs that he has always loved to play, albeit one he has never heard of, where he has to overcome trials and tribulations at every turn as he fights for his life alongside new companions. </p>"; 
